import React, { useState, useEffect } from "react";
import APIStored from "../components/API/APIStored";

function TestingAPI() {
  const [data, setData] = useState([]);

  APIStored()
    .then((response) => {
      console.log(response); // Check the entire response object
      setData(response.data);
    })
    .catch((error) => console.error("Error", error));

  console.log(JSON.stringify(data));
  return (
    <div>
      <table border="1">
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Password</th>
            <th>Mobile</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.first_Name}</td>
              <td>{item.last_Name}</td>
              <td>{item.email}</td>
              <td>{item.password}</td>
              <td>{item.mobile}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TestingAPI;
